def min_elements_changed(n, m, a, b):
    result = []
    for k in range(n - m + 2):
        changed = 0
        for i in range(k, n - m + 1):
            if a[i:i+m] != b:
                changed += 1
        result.append(changed)
    if all(x == result[0] for x in result):
        return [-1]
    return result
